var aColl = document.getElementsByClassName('rectangle'); 
    var bColl = document.getElementsByClassName('circle');

    document.getElementById('A').addEventListener('mouseover', function(){
        aColl.setAttribute('style', 'background-color: red;');
    });

    document.getElementById('B').addEventListener('mouseover', function(){
        aColl.setAttribute('style', 'background-color: darkred;');
    });
